import React from 'react';
import GalleryData from './GalleryData';
import image1 from './images/image1.jpg'
import image4 from './images/image4.jpg'

function Store(){
    return(
        <>
        <div className='d-flex store-container '>
            <figure>
                <img className='img-fluid' src={image1} />
            </figure>
            <figure>
                <img className='img-fluid' src={image4} />
            </figure>
        </div>
        <div className=' button-container  d-flex justify-content-center  my-4 p-2'>
                <button className= 'text-white border-white btn-outline-danger btn fs-4 w-25 mx-auto p-4 ' >Get Weapon NFT</button>
                <button className= 'text-white  border-white btn-outline-danger btn fs-4 w-25 mx-auto p-4 ' >Get Armour NFT</button>
        </div>

        <div>
            {
                GalleryData.map((parameter) => 
                    (  
                    <div className='Col-lg-4 col-md-4  col-10 col-xxl-4 mx-auto'> 
                        <img src={parameter.imageName} className='img-fluid' /> 
                    </div>
                    )
                )
                
            }
        </div>
        </>
    )
}

export default Store;
